                        renderInput={(params) => <TextField {...params} />}
                      />
                    </LocalizationProvider>
                  </Grid>
                </Grid>
                <Grid
                  container
                  style={{
                    justifyContent: 'space-between',
                    paddingTop: 32,
                    width: '85%',
                    margin: '0 auto',
                    paddingBottom: 32,
                  }}
                >
                  <Grid
                    item
                    style={{
                      width: '50%',
                    }}
                  >
                    <Typography className={`${classes.label}`}>
                      {_t_('Report Name')}
                    </Typography>
                    <input
                      value={reportName}
                      className={classes.select}
                      placeholder="Report Name"
                      style={{
                        fontFamily: 'Roboto',
                        fontStyle: 'normal',
                        fontWeight: 500,
                        fontSize: 14,
                      }}
                      onChange={handleReportNameChange}
                    ></input>
                  </Grid>
                  <Grid
                    item
                    style={{
                      width: '50%',
                    }}
                  >
                    <Typography
                      className={`${classes.label}`}
                      style={{ marginBottom: 10 }}
                    >
                      {_t_('Pick End Date')}
                    </Typography>
                    <LocalizationProvider dateAdapter={AdapterDayjs}>
                      <DesktopDatePicker
                        label=""
                        inputFormat="MM/DD/YYYY"
                        value={endDate}
                        onChange={handleChangeEndDate}
                        renderInput={(params) => <TextField {...params} />}
                      />
                    </LocalizationProvider>
                  </Grid>
                </Grid>
                <Grid
                  container
                  style={{
                    justifyContent: 'center',
                  }}
                >
                  <Button
                    size="large"
                    color="primary"
                    variant="contained"
                    onClick={() => {
                      handleContinueClick();
                    }}
                    className={classes.continueButton}
                  >
                    Continue
                  </Button>
                </Grid>
              </>
            ) : (
              <>
                <Grid
                  container
                  style={{
                    justifyContent: 'center',
                    paddingTop: 32,
                    width: '85%',
                    margin: '0 auto',
                  }}
                >
                  <Grid
                    item
                    style={{
                      width: '50%',
                    }}
                  >
                    <Typography
                      className={`${classes.label}`}
                      style={{ textAlign: 'center' }}
                    >
                      {_t_('Upload File')}
                    </Typography>
                    <div
                      className="input-group"
                      style={{ margin: '20px 20px 20px auto', width: 370 }}
                    >
                      <input
                        type="file"
                        onChange={handleFileChange}
                        className="form-control"
                        id="inputGroupFile04"
                        aria-describedby="inputGroupFileAddon04"
                        aria-label="Upload"
                        title="&nbsp;"
                      />
                    </div>
                  </Grid>
                </Grid>
                <Grid
                  container
                  style={{
                    justifyContent: 'center',
                  }}
                >
                  {saving ? (
                    <>
                      <Button
                        size="large"
                        color="primary"
                        variant="contained"
                        onClick={handleSaveClick}
                        className={classes.continueButton}
                      >
                        <CircularProgress />
                      </Button>
                    </>
                  ) : (
                    <>
                      <Button
                        size="large"
                        color="primary"
                        variant="contained"
                        onClick={handleSaveClick}
                        className={classes.continueButton}
                      >
                        Save
                      </Button>
                    </>
                  )}
                </Grid>
              </>
            )}
          </div>
        </DialogContent>
      </Dialog>
    </>
  );
};

export default AdminDashboard;
